let filteredCityList = citiesList.map(city => {
    let requestBody = {
        city: city.cityName,
        province: city.provinceCode,
        startDate: '2021-06-06',
        endDate: '2021-06-10',
    }
    return {
        url: `http://localhost:8000/api/fetchAcrdRates`,
        body: {
            method: 'post',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(requestBody)
        }
    }
})

async function fetchCityRates() {
    let results = []
    for(const city of filteredCityList){
        const cityResult = await fetch(city.url, city.body);
        let cityResultJson = await cityResult.json()
        results.push({
            city,
            cityResultJson
        });
    }
    return results
}

